import './App.css';
import './index.css';

function App() {
  return (
    <div className="App">
      <header>
        <p>Senior Frontend Developer</p>
        <p>Fullstack Developer</p>
        <p>Junior Frontend Developer</p>
        <p>Software Engineer</p>
        <p>Junior Backend Frontend Developer</p>
      </header>
    </div>
  );
}

export default App;
